import React from 'react';
import laptop from '../../laptop.jpg';
import "./Home.css";

const Home = () => (
    <div className="Home">
        <div className="header">
            <img src={laptop} alt="laptop" width="100vw" />
        </div>
        <div className="lander">
            <h1>Home Page</h1>
            <br/>
            <p>This is the home page!</p>
        </div>
    </div>
);

export default Home;
